class Quotation
attr_reader :text, :image_url

  def self.get_quotation(mood)
    a = {"-----" => {"You picked nothing!" => "data:image/jpeg;base64,",
                     "Try again smart guy!" => "https://i.imgflip.com/gwgmi.jpg",
                     "Try another button!" => "https://i.imgflip.com/gwhan.jpg",
                     "BAAAAAAD Choice" => "http://th04.deviantart.net/images3/PRE/i/2005/153/5/f/Smiling_Goat_by_serpentesse.jpg"},
         "Happy" => {"You're having a great day!" => "https://i.imgflip.com/gwkhp.jpg",
                     "Wohoooo!" => "https://i.imgflip.com/gwkbz.jpg",
                     "Hope it continues!" => "http://blogs.centre.edu/healthpsychology2014/files/2014/10/great-keep-it-up-smiley-face.png"},
         "Sad"   => {"Sorry you're feeling down!" => "https://i.imgflip.com/gwh6b.jpg",
                     "The sun will come out tomorrow!" => "https://i.imgflip.com/gwh2w.jpg",
                     "Don't worry Be Happy!" => "http://www.2tees.com/1dontworrybehappyteeshirt.jpg"},
         "Meh"   => {"Show some emotion will you!" => "http://www.meh.ro/wp-content/uploads/2012/04/meh.ro9696-455x455.jpg",
                     "You're a zombie!" => "https://i.imgflip.com/gwhlg.jpg",
                     "Are you even awake!" => "http://s2.quickmeme.com/img/f8/f875afc1a2baad7da2d3f67dbba31d416099c21d889ddc6c56e50c8f8a3b9ff7.jpg"}
        }
    mood_hash = a[mood]
    if mood_hash
      mood_quote = mood_hash.keys.sample
      mood_image = mood_hash[mood_quote]
    end
    return Quotation.new(mood_quote, mood_image)
  end

  def initialize(text, image_url)
    @text = text
    @image_url = image_url
  end
end
